    <script>
        layui.config({
            base: '/themes/js/modules/'
        }).use(['layer', 'jquery', 'laydate', 'common', 'form'], function () {
            var form = layui.form
                , $ = layui.$
                , os = layui.common
                , layer = layui.layer
                , laydate = layui.laydate;
            var index = parent.layer.getFrameIndex(window.name);
            laydate.render({
                elem: '#btime'
                , theme: '#393D49'
                , format: 'yyyy-MM-dd HH:mm:ss'
                , type: 'datetime'
            });
            laydate.render({
                elem: '#etime'
                , theme: '#393D49'
                , format: 'yyyy-MM-dd HH:mm:ss'
                , type: 'datetime'
            });
            form.on('radio', function (data) {
                console.log(data.value);
                if (data.value === '1') {
                    $(""#full"").addClass('layui-hide');
                } else");
                WriteLiteral(@" {
                    $(""#full"").removeClass('layui-hide');
                }
            }); 
            //监听提交
            form.on('submit(submit)', function (data) {
                var urls = ""api/shops/addact"";
                if ($(""#Guid"").val()) {
                    urls = ""api/shops/editact"";
                }
                //console.log(JSON.stringify(data.field)); return false;
                if (data.field.Method == 2) {
                    data.field.CountNum = 0;
                }
                os.ajax(urls, data.field, function (res) {
                    if (res.statusCode == 200) {
                        parent.layer.close(index);
                    }
                    else {
                        os.error(res.message);
                    }
                });
                return false;
            });
            $("".btn-open-close"").on('click', function () {
                parent.layer.close(index);
            });
        });
    </script>
